import {Inject, Injectable} from '@angular/core';
import {DatepickerDate} from "../models/DatepickerDate";
import * as dayjs from 'dayjs';
import * as updateLocale from 'dayjs/plugin/updateLocale';
import * as weekday from 'dayjs/plugin/weekday';
import * as customParseFormat from 'dayjs/plugin/customParseFormat';
import {ConfigType} from "dayjs";
import {DatepickerLocale} from "../injection-tokens/DatepickerLocale";
import {IDatepickerLocale} from "../models/IDatepickerLocale";

@Injectable()
export class DatepickerDateService {
  constructor(
    @Inject(DatepickerLocale) private localeConfig: IDatepickerLocale
  ) {
    dayjs.extend(updateLocale);
    dayjs.extend(weekday);
    dayjs.extend(customParseFormat);
    // Dayjs locale name does not change
    dayjs.updateLocale('en', {
      weekStart: this.localeConfig.weekStart
    });
  }

  public create(config?: ConfigType): DatepickerDate {
    return new DatepickerDate(config);
  }
}

import { ComponentRef, ElementRef, Injectable, InjectionToken, Injector } from '@angular/core';
import {Overlay, OverlayConfig, OverlayRef} from "@angular/cdk/overlay";
import {DatepickerOverlayComponent} from "../components/datepicker-overlay/datepicker-overlay.component";
import {ComponentPortal} from "@angular/cdk/portal";
import {DatepickerOverlayRef} from "../models/DatepickerOverlayRef";
import {DatepickerService} from "./datepicker.service";
import { DatepickerConfig } from "../models/DatepickerConfig";

export const DatepickerConfigToken = new InjectionToken<DatepickerConfig>('DatepickerConfig');

@Injectable()
export class DatepickerOverlayService {

  constructor(
    private overlay: Overlay,
    private injector: Injector
  ) { }

  public open(connectedTo: ElementRef, datepickerService: DatepickerService, config?: DatepickerConfig) {
    const overlayRef = this.createOverlay(connectedTo);
    const dialogRef = new DatepickerOverlayRef(overlayRef);
    this.attachOverlayContainer(overlayRef, dialogRef, datepickerService, config);
    overlayRef.backdropClick().subscribe(() => dialogRef.close());
    return dialogRef;
  }

  private createOverlay(connectedTo: ElementRef) {
    const overlayConfig = this.getOverlayConfig(connectedTo);
    return this.overlay.create(overlayConfig);
  }

  private attachOverlayContainer(overlayRef: OverlayRef, dialogRef: DatepickerOverlayRef, datepickerService: DatepickerService, config?: DatepickerConfig): DatepickerOverlayComponent {
    const injector = this.createInjector(dialogRef, datepickerService, config);
    const containerPortal = new ComponentPortal(DatepickerOverlayComponent, null, injector);
    const containerRef: ComponentRef<DatepickerOverlayComponent> = overlayRef.attach(containerPortal);
    return containerRef.instance;
  }

  private getOverlayConfig(connectedTo: ElementRef) {
    const positionStrategy = this.overlay.position()
      .flexibleConnectedTo(connectedTo)
      .withPositions([{
        originX: 'start',
        originY: 'bottom',
        overlayX: 'start',
        overlayY: 'top',
      }]);

    const overlayConfig = new OverlayConfig({
      hasBackdrop: true,
      backdropClass: 'my-backdrop',
      scrollStrategy: this.overlay.scrollStrategies.reposition(),
      positionStrategy
    });

    return overlayConfig;
  }

  private createInjector(dialogRef: DatepickerOverlayRef, datepickerService: DatepickerService, config?: DatepickerConfig): Injector {
    return Injector.create({
      parent: this.injector,
       providers: [
         { provide: DatepickerOverlayRef, useValue: dialogRef },
         { provide: DatepickerService, useValue: datepickerService },
         { provide: DatepickerConfigToken, useValue: config }
       ]
    });
  }
}

import { Injectable } from '@angular/core';
import { BehaviorSubject, Observable } from "rxjs";
import { DatepickerDate } from "../models/DatepickerDate";
import { DatepickerDateService } from "./datepicker-date.service";


@Injectable()
export class DatepickerService {
  private _selectedDate$: BehaviorSubject<DatepickerDate | null> = new BehaviorSubject<DatepickerDate | null>(null);

  private _selectedDate: DatepickerDate | undefined;

  private _currentSelectedDate$: BehaviorSubject<DatepickerDate> = new BehaviorSubject<DatepickerDate>(this.datepickerDateService.create());

  public get selectedDate$(): Observable<DatepickerDate | null> {
    return this._selectedDate$.pipe();
  }

  public get selectedDate(): DatepickerDate | undefined {
    return this._selectedDate;
  }

  public get currentSelectedDate$(): Observable<DatepickerDate> {
    return this._currentSelectedDate$.pipe();
  }

  public get currentSelectedDate(): DatepickerDate {
    return this._currentSelectedDate$.getValue();
  }

  public get currentDate(): DatepickerDate {
    return this.datepickerDateService.create();
  }

  constructor(
    private datepickerDateService: DatepickerDateService
  ) {  }

  setSelectedDate(date: Date): void {
    this._selectedDate$.next(this.datepickerDateService.create(date));
  }

  setCurrentSelectedDate(date: Date): void {
    this._currentSelectedDate$.next(this.datepickerDateService.create(date));
  }

  getMonthDates(d: Date): (DatepickerDate | null)[][] {
    const date = this.datepickerDateService.create(d).setDate(1);
    const monthStartDay: number = date.getDay();
    const daysInMonth = date.getDaysInMonth();
    const daysInMonthWithStartNulls = daysInMonth + monthStartDay;
    const flatMonthDays = new Array(daysInMonthWithStartNulls).fill(null).map((_, i) => {
      if (i < monthStartDay || i > daysInMonthWithStartNulls) { return null }
      else {
        return date.setDate(i - monthStartDay + 1);
      }
    });

    const DAYS_IN_WEEK = 7;
    const result: (DatepickerDate | null)[][] = [];
    while(flatMonthDays.length > 0) {
      const weekDates = flatMonthDays.splice(0, DAYS_IN_WEEK);
      result.push(weekDates);
    }
    return result;
  }

  getYears(offset: number = 0): number[] {
    const selectedYear = this.currentSelectedDate.getYear();
    const startDecadeYear = (Math.floor(selectedYear / 10) + offset) * 10;
    return new Array(10).fill(0).map((v, i) => startDecadeYear + i);
  }
}

